import { Card } from "./ui/card";
export function AnalyticsTab() {
  const dataSet = [
    {
      station: "Outpatient Stations",
      substations: [
        "Testicular Lump",
        "Raised PSA",
        "Haematuria",
        "Renal mass",
        "OAB",
      ],
    },
    {
    station: "Emergency Station", 
    substations: [
        'AUR', 'Renal colic', 
    ]
    }
  ];
  return (
    <div>
      <Card>
        <h1>Urology Interview</h1>
      </Card>
    </div>
  );
}
